import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import JobF from "./Components/JobF/JobForm";
import Landing from "./Components/LandPage/Landing";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Default page */}
        <Route path="/" element={<Landing />} />

        {/* Repair page (same as landing for now) */}
        <Route path="/repairs" element={<Landing />} />

        {/* Job Form page */}
        <Route path="/jobform" element={<JobF />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
